all_stabs = [s.strip() for s in all_stabs_str.strip().split('\n')]
n_qubits = len(all_stabs[0])
n_stabs = len(all_stabs)

print(f"Number of qubits: {n_qubits}")
print(f"Number of stabilizers: {n_stabs}")

# Convert to stim PauliStrings
pauli_strings = [stim.PauliString(s) for s in all_stabs]

# Check commutativity
print("\nBuilding commutativity matrix...")
n = len(pauli_strings)
commutes = np.ones((n, n), dtype=bool)
for i in range(n):
    for j in range(i+1, n):
        if not pauli_strings[i].commutes(pauli_strings[j]):
            commutes[i,j] = False
            commutes[j,i] = False

# Count anti-commutations
anticommute_count = np.sum(~commutes) // 2
print(f"Number of anticommuting pairs: {anticommute_count}")

# Find maximal commuting subset using greedy algorithm
print("\nFinding maximal commuting subset...")
selected = []
candidates = list(range(n))

# Start with the first stabilizer
if candidates:
    selected.append(candidates[0])
    candidates = candidates[1:]

while candidates:
    # Find a candidate that commutes with all selected
    for c in candidates:
        commutes_with_all = True
        for s in selected:
            if not commutes[c, s]:
                commutes_with_all = False
                break
        if commutes_with_all:
            selected.append(c)
            candidates.remove(c)
            break
    else:
        # No candidate commutes with all selected
        break

print(f"Found commuting subset of size: {len(selected)}")
print(f"Selected stabilizer indices: {selected[:20]}...")

# Build the circuit from the maximal commuting subset
selected_stabs = [all_stabs[i] for i in selected]
selected_pauli_strings = [stim.PauliString(s) for s in selected_stabs]

print("\nGenerating circuit from maximal commuting subset...")
try:
    tableau = stim.Tableau.from_stabilizers(selected_pauli_strings, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit(method='elimination')
    print(f"Circuit generated successfully!")
    print(f"Circuit has {len(circuit)} operations")
    
    # Save circuit
    with open(r"data\gpt5.2\agent_files\circuit_155_maximal.stim", "w") as f:
        f.write(str(circuit))
    
    print("\nCircuit saved to data\\gpt5.2\\agent_files\\circuit_155_maximal.stim")
except Exception as e:
    print(f"Error: {e}")
